import './CalendarView.css';

const CalendarView = () => {
  // Your existing code

  return (
    <div>
      <Navbar />
      <div>
        <h2>Appointment Calendar</h2>
        {/* Apply custom styles to the Calendar component */}
        <Calendar
          onChange={setDate}
          value={date}
          tileClassName={tileClassName}
          className="custom-calendar" // Add a custom class name for styling
        />
        <div className="appointment-details">
          <h3>Appointments on {date.toDateString()}</h3>
          <ul>
            {/* Your existing appointment list */}
          </ul>
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default CalendarView;
